Sure! Below is an example of a Discord bot using Discord.js v14 that includes a single slash command: `ban`. This command will allow users with the necessary permissions to ban a member from the server.

First, make sure you have the required packages installed. You can install them using npm:

```sh
npm install discord.js @discordjs/builders @discordjs/rest discord-api-types node-fetch
```

Now, let's write the code for the bot:

```javascript
const { Client, GatewayIntentBits, SlashCommandBuilder } = require('discord.js');
const { REST } = require('@discordjs/rest');
const { Routes } = require('discord-api-types/v9');

// Replace with your bot token
const TOKEN = 'YOUR_BOT_TOKEN';

// Replace with your guild ID
const GUILD_ID = 'YOUR_GUILD_ID';

// Create a new client instance
const client = new Client({
    intents: [
        GatewayIntentBits.Guilds,
        GatewayIntentBits.GuildMembers,
        GatewayIntentBits.GuildMessages,
        GatewayIntentBits.MessageContent,
    ],
});

// Define the slash command
const banCommand = new SlashCommandBuilder()
    .setName('ban')
    .setDescription('Bans a user from the server.')
    .addUserOption(option =>
        option.setName('user')
            .setDescription('The user to ban')
            .setRequired(true))
    .addIntegerOption(option =>
        option.setName('days')
            .setDescription('Number of days to ban the user for (default is 7)')
            .setMinValue(0)
            .setMaxValue(28)
            .setRequired(false));

// Function to handle the ban command
async function handleBanCommand(interaction) {
    const user = interaction.options.getUser('user');
    const reason = interaction.options.getString('reason') || 'No reason provided';
    const days = interaction.options.getInteger('days') || 7;

    // Ensure the user has permission to ban members
    if (!interaction.member.permissions.has('BAN_MEMBERS')) {
        return interaction.reply({ content: 'You do not have permission to use this command.', ephemeral: true });
    }

    try {
        await interaction.guild.bans.create(user.id, days);
        await interaction.reply({ content: `User ${user} has been banned for ${days} day(s) due to: ${reason}`, ephemeral: true });
    } catch (error) {
        console.error(error);
        await interaction.reply({ content: 'An error occurred while banning the user.', ephemeral: true });
    }
}

// Register the command with the REST API
const commands = [banCommand];
const rest = new REST({ version: '9' }).setToken(TOKEN);

(async () => {
    try {
        console.log('Started refreshing application (/) commands.');

        await rest.put(
            Routes.applicationCommands(GUILD_ID),
            { body: commands },
        );

        console.log('Successfully reloaded application (/) commands.');
    } catch (error) {
        console.error(error);
    }
})();

// Listen for the 'ready' event and register the command
client.on('ready', () => {
    console.log(`Logged in as ${client.user.tag}!`);
});

// Listen for interactions and execute the ban command
client.on('interactionCreate', async (interaction) => {
    if (!interaction.isChatInputCommand()) return;

    if (interaction.commandName === 'ban') {
        await handleBanCommand(interaction);
    }
});

// Login to Discord with your bot's token
client.login(TOKEN);
```

### Explanation:
1. **Dependencies**: We import the necessary modules from `discord.js`, `@discordjs/builders`, `@discordjs/rest`, and `discord-api-types`.
2. **Client Setup**: We create a new client instance with the required intents.
3. **Slash Command Definition**: We define a slash command named `ban` which requires a user and an optional number of days to ban.
4. **Handling the Ban Command**: We implement the logic to handle the ban command, including checking if the user has the necessary permissions to ban members.
5. **Registering Commands**: We register the command with the Discord API for the specified guild.
6. **Event Listeners**: We listen for the `ready` event to log when the bot is online and for `interactionCreate` events to process the `ban` command.

Make sure to replace `'YOUR_BOT_TOKEN'` and `'YOUR_GUILD_ID'` with your actual bot token and guild ID. This code assumes you have the necessary permissions and roles set up on your Discord server.

