```

### Step 2: Create the Game Code

Here's a basic implementation of the Snake game:

```c
#include <SDL.h>
#include <stdio.h>
#include <stdlib.h>
#include <time.h>

#define SCREEN_WIDTH 640
#define SCREEN_HEIGHT 480
#define BLOCK_SIZE 20

typedef struct {
    int x, y;
} Point;

Point food;
Point head;
Point body[300];
int tail = 0;
int score = 0;
int speed = 10;
bool running = true;
bool food_eaten = false;

void init_game() {
    srand(time(NULL));
    head.x = SCREEN_WIDTH / 2;
    head.y = SCREEN_HEIGHT / 2;
    food.x = rand() % (SCREEN_WIDTH / BLOCK_SIZE) * BLOCK_SIZE;
    food.y = rand() % (SCREEN_HEIGHT / BLOCK_SIZE) * BLOCK_SIZE;
}

void render(SDL_Renderer* renderer) {
    // Clear screen
    SDL_SetRenderDrawColor(renderer, 0, 0, 0, 255);
    SDL_RenderClear(renderer);

    // Draw food
    SDL_SetRenderDrawColor(renderer, 255, 0, 0, 255);
    SDL_Rect foodRect = {food.x, food.y, BLOCK_SIZE, BLOCK_SIZE};
    SDL_RenderFillRect(renderer, &foodRect);

    // Draw snake
    SDL_SetRenderDrawColor(renderer, 0, 255, 0, 255);
    for (int i = 0; i < tail; i++) {
        SDL_Rect bodyRect = {body[i].x, body[i].y, BLOCK_SIZE, BLOCK_SIZE};
        SDL_RenderFillRect(renderer, &bodyRect);
    }

    // Update screen
    SDL_RenderPresent(renderer);
}

void update_game() {
    if (!running) return;

    // Move the snake
    for (int i = tail; i > 0; i--) {
        body[i] = body[i - 1];
    }
    body[0] = head;

    // Check for food collision
    if (head.x == food.x && head.y == food.y) {
        food_eaten = true;
        score++;
        tail++;
        if (tail >= 300) {
            tail = 300;
        }
    }

    // Check for wall collision
    if (head.x < 0 || head.x >= SCREEN_WIDTH || head.y < 0 || head.y >= SCREEN_HEIGHT) {
        running = false;
    }

    // Check for self-collision
    for (int i = 0; i < tail; i++) {
        if (head.x == body[i].x && head.y == body[i].y) {
            running = false;
        }
    }

    // Generate new food if eaten
    if (food_eaten) {
        food.x = rand() % (SCREEN_WIDTH / BLOCK_SIZE) * BLOCK_SIZE;
        food.y = rand() % (SCREEN_HEIGHT / BLOCK_SIZE) * BLOCK_SIZE;
        food_eaten = false;
    }
}

void handle_input(SDL_Event* event) {
    switch (event->type) {
        case SDL_QUIT:
            running = false;
            break;
        case SDL_KEYDOWN:
            switch (event->key.keysym.sym) {
                case SDLK_UP:
                    if (head.y != food.y - BLOCK_SIZE) {
                        head.y -= BLOCK_SIZE;
                    }
                    break;
                case SDLK_DOWN:
                    if (head.y != food.y + BLOCK_SIZE) {
                        head.y += BLOCK_SIZE;
                    }
                    break;
                case SDLK_LEFT:
                    if (head.x != food.x + BLOCK_SIZE) {
                        head.x -= BLOCK_SIZE;
                    }
                    break;
                case SDLK_RIGHT:
                    if (head.x != food.x - BLOCK_SIZE) {
                        head.x += BLOCK_SIZE;
                    }
                    break;
            }
            break;
    }
}

int main(int argc, char* argv[]) {
    if (SDL_Init(SDL_INIT_VIDEO) < 0) {
        fprintf(stderr, "Could not initialize SDL: %s\n", SDL_GetError());
        return 1;
    }

    SDL_Window* window = SDL_CreateWindow("Snake Game",
                                          SDL_WINDOWPOS_UNDEFINED,
                                          SDL_WINDOWPOS_UNDEFINED,
                                          SCREEN_WIDTH,
                                          SCREEN_HEIGHT,
                                          SDL_WINDOW_SHOWN);
    if (!window) {
        fprintf(stderr, "Could not create window: %s\n", SDL_GetError());
        SDL_Quit();
        return 1;
    }

    SDL_Renderer* renderer = SDL_CreateRenderer(window, -1, SDL_RENDERER_ACCELERATED);
    if (!renderer) {
        fprintf(stderr, "Could not create renderer: %s\n", SDL_GetError());
        SDL_DestroyWindow(window);
        SDL_Quit();
        return 1;
    }

    init_game();

    while (running) {
        SDL_Event event;
        while (SDL_PollEvent(&event)) {
            handle_input(&event);
        }

        update_game();
        render(renderer);
        SDL_Delay(1000 / speed);
    }

    SDL_DestroyRenderer(renderer);
    SDL_DestroyWindow(window);
    SDL_Quit();

    return 0;
}
```

### Explanation:

1. **Initialization**: The `init_game` function initializes the starting position of the snake and the first piece of food.
2. **Rendering**: The `render` function clears the screen and draws the snake and food using rectangles.
3. **Game Logic**: The `update_game` function updates the snake's position, checks for collisions with walls and itself, and generates new food if the snake eats the current food.
4. **Input Handling**: The `handle_input` function processes keyboard inputs to change the direction of the snake.
5. **Main Loop**: The main loop handles events, updates the game state, and renders the scene at regular intervals.

### Running the Game

To compile and run the game, save the code to a file, e.g., `snake.c`, and use a C compiler like `gcc`:

```sh
gcc -o snake snake.c -lSDL2 -lSDL2_image
./snake
```

Make sure that the `libSDL2` and `libSDL2_image` libraries are correctly linked during compilation.

This is a basic implementation, and you can enhance it by adding more features like different levels, scoring systems, and visual effects.

